// Error reporting
static void pabort(const char *s) {
	perror(s);
	abort();
}

// Get the current time in microseconds
unsigned int getTime() {
	struct timeval time;
	gettimeofday(&time, NULL);
	long start = ((unsigned long long)time.tv_sec * 1000000) + time.tv_usec;
	return start;
}

// Calculate the difference from a start time in microseconds
unsigned int getDiff(long start) {
	long next = getTime();
 	long diff = next - start;
 	return diff;
}

