// Set all LEDs to the color code (eg. #FFFFFF), PCB LEDs are ordered BGR
void setAll(int color) {
	char y;
	for (y = 0; y < Y_COORDS; ++y) {
		pin_out[y*3+0] = ((color & 0x0000FF) >>  0) / 32;
		pin_out[y*3+1] = ((color & 0x00FF00) >>  8) / 32;
		pin_out[y*3+2] = ((color & 0xFF0000) >> 16) / 32;
	}
}

// Set one pin, PCB LEDs are ordered BGR
void setOne(char y, unsigned char b, unsigned char g, unsigned char r) {
	pin_out[y*3+0] = b / 32;
	pin_out[y*3+1] = g / 32;
	pin_out[y*3+2] = r / 32;
}

// Set one pin
void setOneFromMap(char x, char y) {
	setOne(y, 	MAP[x*3 + y*X_COORDS*3 + 2], 
				MAP[x*3 + y*X_COORDS*3 + 1],
				MAP[x*3 + y*X_COORDS*3 + 0]);
}

// set map to color, override
void setMap(int color) {
	char x, y, rgb;
	for (y = 0; y < Y_COORDS; ++y) {
		for (x = 0; x < X_COORDS; ++x) {
			for(rgb = 0; rgb < 3; ++rgb) {
				MAP[x*3 + y*X_COORDS*3 + rgb] = 0x00;
			}
		}
	}
}

//fill Map with color at text,
void fillLine(char* str, char strCol, int color) {
    char charIndex, x, y;  	// character index on for a string row on MAP, limited by X_COORDS
    for (charIndex = 0; charIndex < 15 && str[charIndex] != "\0"; ++charIndex) {
    	for (y = 0; y < 8; ++y) {
    		for(x = 0; x < 8; ++x) {
    			MAP[(charIndex*8+x)*3 + (strCol*8+y)*X_COORDS*3 + 0] = ((textIndex[str[charIndex]           *8 + y] >> (7 - x)) & 1) * ((color & 0xFF0000) >> 16);
    			MAP[(charIndex*8+x)*3 + (strCol*8+y)*X_COORDS*3 + 1] = ((textIndex[str[charIndex]           *8 + y] >> (7 - x)) & 1) * ((color & 0x00FF00) >>  8);
    			MAP[(charIndex*8+x)*3 + (strCol*8+y)*X_COORDS*3 + 2] = ((textIndex[str[charIndex]           *8 + y] >> (7 - x)) & 1) * ((color & 0x0000FF) >>  0);
    		}								                         //((textIndex[ord(string[mapCharIndex])*8 + j] >> (7 - i)) & 1) * color
    	}
    }
}

// Function for modifying the variable scroll_offset_X, prevents it from going out of range
void scrollMap(long vector) {
	scroll_offset_X = scroll_offset_X + vector;
	if(scroll_offset_X >= X_COORDS) {
		scroll_offset_X = scroll_offset_X - X_COORDS;
	} else if( scroll_offset_X < 0) {
		scroll_offset_X = scroll_offset_X + X_COORDS;
	}
	printf("%d", scroll_offset_X);
	puts("");
}

// simple print Map for debugging. if any color is active, display 1, else blank
void printMap() {
	char y;
	long x;
	long pos;
	for (y = 0; y < Y_COORDS; ++y) {
		for (x = 0; x < X_COORDS; ++x) {
			pos = x + scroll_offset_X;
			if(pos >= X_COORDS) pos = pos - X_COORDS;
			if(    MAP[pos*3 + y*X_COORDS*3 + 0] 
				|| MAP[pos*3 + y*X_COORDS*3 + 1] 
				|| MAP[pos*3 + y*X_COORDS*3 + 2]) {
				char temp = (MAP[pos*3 + y*X_COORDS*3 + 0] > MAP[pos*3 + y*X_COORDS*3 + 1]) ? MAP[pos*3 + y*X_COORDS*3 + 0] : MAP[pos*3 + y*X_COORDS*3 + 0];
				temp = (temp > MAP[pos*3 + y*X_COORDS*3 + 2]) ? temp : MAP[pos*3 + y*X_COORDS*3 + 2];
				temp = temp /32;
				printf("%d", temp);
			} else {
				printf(" ");
			}
		}
		puts("");
	}
}

// Clear the TX buffer
void clearTX() {
	char i = 0;
	for(i = 0; i < NUM_SHIFTREG; ++i) {
		tx[i] = 0x00;
	}
}

// Set the TX buffer with pin color data
void setTX(char frame) {
	char i = 0;
	char offset = 0;
	char index = 0;

	for(i = 0; i < NUM_SHIFTREG * 8; ++i) {
		index = (NUM_SHIFTREG - 1) - (i / 8);
		offset = i % 8;
		tx[index] = tx[index] | (((pin_out[i] & frame) >> (frame / 2)) << offset);
	}
}

// Send data out via SPI
static void transfer(int fd) {
	int ret;

	struct spi_ioc_transfer tr = {
		.tx_buf = (unsigned long)tx,
		.len = ARRAY_SIZE(tx),
		.delay_usecs = delay,
		.speed_hz = speed,
		.bits_per_word = bits,
	};

	ret = ioctl(fd, SPI_IOC_MESSAGE(1), &tr);
	if (ret < 1)
		pabort("can't send spi message");
}

// Draw one BCM frame for one X
void cycleOne(int fd, char x_col, char frame) {
	long pos = x_col + scroll_offset_X;
	if(pos >= X_COORDS) pos = pos - X_COORDS;

	clearTX();
	char y;
	for(y = 0; y < Y_COORDS; ++y) {
		setOneFromMap(pos, y);	
	}
	setTX(frame);
	transfer(fd);
}

// Draw all x coordinates for a given BCM frame
void cycle(int fd, char frame) {
	long x;
	
	for(x = 0; x < X_COORDS; ++x) {
		cycleOne(fd, x, frame);
	}
}

char* getTimestr() {
	static char temp[15];
	time_t now = time(NULL);
	struct tm *t = localtime(&now);

	strftime(temp, sizeof(temp)-1, "%X %p %Z", t);
	return temp;
}

char* getDatestr() {
	static char temp[15];
	time_t now = time(NULL);
	struct tm *t = localtime(&now);

	strftime(temp, sizeof(temp)-1, "%B %d, %G", t);
	return temp;
}	

