void *thread_hz () {
	char x;
	bool dist = false;					
	// Distributed Load, requires 7x rpm, untested
	if(dist) {
		cycle(fd, 1);
		cycle(fd, 2);
		cycle(fd, 2);
		cycle(fd, 4);
		cycle(fd, 4);
		cycle(fd, 4);
		cycle(fd, 4);
	}

	// No distribution
	if(!dist) {
		// Draw all BCM frames at once per X coordinate
		for(x = 0; x < X_COORDS; ++x) {
			cycleOne(fd, x, 1);
			cycleOne(fd, x, 2);
			cycleOne(fd, x, 2);
			cycleOne(fd, x, 4);
			cycleOne(fd, x, 4);
			cycleOne(fd, x, 4);
			cycleOne(fd, x, 4);
		}
	}		
}

void *thread_sec () {
	char i;
	for(i = 0; i < REFRESH_HERTZ; ++i) { // Hz and Sync, any higher syncs cause large delay, tuning with timers is costly
		pthread_t *tid = malloc( sizeof(pthread_t) );
        pthread_create( &tid, NULL, thread_hz, NULL);
        
        update_on_FPS();
        //printf("%d", i); puts("");

		usleep(TIMESYNC_HZ);						
		pthread_join(tid, NULL);		
	}
}

